import React from 'react';

const Frame7a = () => {
  return (
    <div
      style={{
        width: '1440px',
        minHeight: '174px',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'center',
        background: 'rgba(28,38,76,1)',
      }}
    >
      <img
        src="/frame113.png"
        alt="Frame113"
        style={{ maxHeight: '120px', background: 'rgba(28,38,76,1)', borderRadius: '8px' }}
      />
    </div>
  );
};

export default Frame7a;
